Add multiple directories to the `-I` include path.

# Example

```no_run
# use std::path::Path;
# let condition = true;
#
let mut extra_dir = None;
if condition {
    extra_dir = Some(Path::new("/path/to"));
}

cc::Build::new()
    .file("src/foo.c")
    .includes(extra_dir)
    .compile("foo");
```

